import React from 'react';
import { useNavigate } from 'react-router-dom';

const TopPage: React.FC = () => {
  const navigate = useNavigate();

  return (
    <div style={{ backgroundColor: 'black', color: 'white', height: '100vh', padding: '20px' }}>
      <h1>一時チャットアプリ</h1>
      <button onClick={() => navigate('/create')} style={{ backgroundColor: 'gray', color: 'white', marginRight: '10px' }}>
        チャット作成
      </button>
      <button onClick={() => navigate('/join')} style={{ backgroundColor: 'gray', color: 'white' }}>
        チャット参加
      </button>
    </div>
  );
};

export default TopPage;
